"use strict";

var Message = require(__dirname + "/../Message"),
    Outcoming; // constructor, function

/**
 * @auguments Bender/HttpServer/Message
 * @constructor
 * @param {Date} date
 */
Outcoming = function (date) {
    Message.call(this, date);
};
Outcoming.prototype = Object.create(Message.prototype);

module.exports = Outcoming;
